import React from "react";
import "../App.css";
import TaskItem from "./TaskItem";

const TaskList = (props) => {
  return (
    <table>
      <thead>
        <tr>
          <td>Id</td>
          <td>Name</td>
          <td>Deadline</td>
          <td>Status</td>
        </tr>
      </thead>
      <tbody>
        {props.map((task) => (
          <TaskItem
            id={props.id}
            name={props.taskName}
            deadline={props.deadline}
            status={props.status}
          />
        ))}
      </tbody>
    </table>
  );
};

export default TaskList;
